insert into description (poke_id, pokedex_entry) values (1, 'A strange seed was planted on its back at birth. The plant sprouts and grows with this POKMON.');
insert into description (poke_id, pokedex_entry) values (1, 'There is a plant seed on its back right from the day this POKMON is born. The seed slowly grows larger.');
insert into description (poke_id, pokedex_entry) values (1, 'It can go for days without eating a single morsel. In the bulb on its back, it stores energy.');
insert into description (poke_id, pokedex_entry) values (2, 'When the bulb on its back grows large, it appears to lose the ability to stand on its hind legs.');
insert into description (poke_id, pokedex_entry) values (2, 'There is a plant bulb on its back. When it absorbs nutrients, the bulb is said to blossom into a large flower.');
insert into description (poke_id, pokedex_entry) values (2, 'The bulb on its back grows by drawing energy. It gives off an aroma when it is ready to bloom.');
insert into description (poke_id, pokedex_entry) values (3, 'The plant blooms when it is absorbing solar energy. It stays on the move to seek sunlight.');
insert into description (poke_id, pokedex_entry) values (3, 'A bewitching aroma wafts from its flower. The fragrance becalms those engaged in a battle.');
insert into description (poke_id, pokedex_entry) values (3, 'The flower on its back catches the sun''s rays. The sunlight is then absorbed and used for energy.');
insert into description (poke_id, pokedex_entry) values (4, 'Obviously prefers hot places. When it rains, steam is said to spout from the tip of its tail.');
insert into description (poke_id, pokedex_entry) values (4, 'From the time it is born, a flame burns at the tip of its tail. Its life would end if the flame were to go out.');
insert into description (poke_id, pokedex_entry) values (4, 'The flame at the tip of its tail makes a sound as it burns. You can only hear it in quiet places.');
insert into description (poke_id, pokedex_entry) values (5, 'When it swings its burning tail, it elevates the temperature to unbearably high levels.');
insert into description (poke_id, pokedex_entry) values (5, 'It lashes about with its tail to knock down its foe. It then tears up the fallen opponent with sharp claws.');
insert into description (poke_id, pokedex_entry) values (5, 'Tough fights could excite this POKMON. When excited, it may blow out bluish- white flames.');
insert into description (poke_id, pokedex_entry) values (6, 'Spits fire that is hot enough to melt boulders. Known to cause forest fires unintentionally.');
insert into description (poke_id, pokedex_entry) values (6, 'Its wings can carry this POKMON close to an altitude of 4,600 feet. It blows out fire at very high temperatures.');
insert into description (poke_id, pokedex_entry) values (6, 'When expelling a blast of super hot fire, the red flame at the tip of its tail burns more intensely.');
insert into description (poke_id, pokedex_entry) values (7, 'After birth, its back swells and hardens into a shell. Powerfully sprays foam from its mouth.');
insert into description (poke_id, pokedex_entry) values (7, 'When it retracts its long neck into its shell, it squirts out water with vigorous force.');
insert into description (poke_id, pokedex_entry) values (7, 'Shoots water at prey while in the water. Withdraws into its shell when in danger.');
insert into description (poke_id, pokedex_entry) values (8, 'Often hides in water to stalk unwary prey. For swimming fast, it moves its ears to maintain balance.');
insert into description (poke_id, pokedex_entry) values (8, 'This POKMON is very popular as a pet. Its fur-covered tail is a symbol of its longevity.');
insert into description (poke_id, pokedex_entry) values (8, 'When tapped, this POKMON will pull in its head, but its tail will still stick out a little bit.');
insert into description (poke_id, pokedex_entry) values (9, 'A brutal POKMON with pressurized water jets on its shell. They are used for high speed tackles.');
insert into description (poke_id, pokedex_entry) values (9, 'It crushes its foe under its heavy body to cause fainting. In a pinch, it will withdraw inside its shell.');
insert into description (poke_id, pokedex_entry) values (9, 'Once it takes aim at its enemy, it blasts out water with even more force than a fire hose.');
insert into description (poke_id, pokedex_entry) values (10, 'Its short feet are tipped with suction pads that enable it to tirelessly climb slopes and walls.');
insert into description (poke_id, pokedex_entry) values (10, 'It is covered with a green skin. When it grows, it sheds the skin, covers itself with silk, and becomes a cocoon.');
insert into description (poke_id, pokedex_entry) values (10, 'If you touch the feeler on top of its head, it will release a horrible stink to protect itself.');
insert into description (poke_id, pokedex_entry) values (11, 'This POKMON is vulnerable to attack while its shell is soft, exposing its weak and tender body.');
insert into description (poke_id, pokedex_entry) values (11, 'Even though it is encased in a sturdy shell, the body inside is tender. It cant withstand a harsh attack.');
insert into description (poke_id, pokedex_entry) values (11, 'Hardens its shell to protect itself. However, a large impact may cause it to pop out of its shell.');
insert into description (poke_id, pokedex_entry) values (12, 'In battle, it flaps its wings at high speed to release highly toxic dust into the air.');
insert into description (poke_id, pokedex_entry) values (12, 'The wings are protected by rain-repellent dust. As a result, this POKMON can fly about even in rain.');
insert into description (poke_id, pokedex_entry) values (12, 'Its wings, covered with poisonous powders, repel water. This allows it to fly in the rain.');
insert into description (poke_id, pokedex_entry) values (13, 'Often found in forests, eating leaves. It has a sharp venomous stinger on its head.');
insert into description (poke_id, pokedex_entry) values (13, 'Often found in forests and grasslands. It has a sharp, toxic barb of around two inches on top of its head.');
insert into description (poke_id, pokedex_entry) values (13, 'Beware of the sharp stinger on its head. It hides in grass and bushes where it eats leaves.');
insert into description (poke_id, pokedex_entry) values (14, 'Almost incapable of moving, this POKMON can only harden its shell to protect itself from predators.');
insert into description (poke_id, pokedex_entry) values (14, 'This POKMON is in a temporary stage while making its body. It is almost completely unable to move on its own.');
insert into description (poke_id, pokedex_entry) values (14, 'Able to move only slightly. When endangered, it may stick out its stinger and poison its enemy.');
insert into description (poke_id, pokedex_entry) values (15, 'Flies at high speed and attacks using its large venomous stingers on its forelegs and tail.');
insert into description (poke_id, pokedex_entry) values (15, 'May appear in a swarm. Flies at violent speeds, all the while stabbing with the toxic stinger on its rear.');
insert into description (poke_id, pokedex_entry) values (15, 'It has 3 poisonous stingers on its forelegs and its tail. They are used to jab its enemy repeatedly.');
insert into description (poke_id, pokedex_entry) values (16, 'A common sight in forests and woods. It flaps its wings at ground level to kick up blinding sand.');
insert into description (poke_id, pokedex_entry) values (16, 'Does not like to fight. It hides in tall grass and so on, foraging for food such as small bugs.');
insert into description (poke_id, pokedex_entry) values (16, 'Very docile. If attacked, it will often kick up sand to protect itself rather than fight back.');
insert into description (poke_id, pokedex_entry) values (17, 'Very protective of its sprawling territorial area, this POKMON will fiercely peck at any intruder.');
insert into description (poke_id, pokedex_entry) values (17, 'The claws on its feet are well developed. It can carry prey such as an EXEGGCUTE to its nest over 60 miles away.');
insert into description (poke_id, pokedex_entry) values (17, 'This POKMON is full of vitality. It constantly flies around its large territory in search of prey.');
insert into description (poke_id, pokedex_entry) values (18, 'When hunting, it skims the surface of water at high speed to pick off unwary prey such as MAGIKARP.');
insert into description (poke_id, pokedex_entry) values (18, 'It spreads its gorgeous wings widely to intimidate enemies. It races through the skies at Mach-2 speed.');
insert into description (poke_id, pokedex_entry) values (18, 'This POKMON flies at Mach 2 speed, seeking prey. Its large talons are feared as wicked weapons.');
insert into description (poke_id, pokedex_entry) values (19, 'Bites anything when it attacks. Small and very quick, it is a common sight in many places.');
insert into description (poke_id, pokedex_entry) values (19, 'Its fangs are long and very sharp. They grow continuously, so it gnaws on hard things to whittle them down.');
insert into description (poke_id, pokedex_entry) values (19, 'Will chew on any thing with its fangs. If you see one, it is certain that 40 more live in the area.');
insert into description (poke_id, pokedex_entry) values (20, 'It uses its whis kers to maintain its balance. It apparently slows down if they are cut off.');
insert into description (poke_id, pokedex_entry) values (20, 'Its rear feet have three toes each. They are webbed, enabling it to swim across rivers.');
insert into description (poke_id, pokedex_entry) values (20, 'Its hind feet are webbed. They act as flippers, so it can swim in rivers and hunt for prey.');
insert into description (poke_id, pokedex_entry) values (21, 'Eats bugs in grassy areas. It has to flap its short wings at high speed to stay airborne.');
insert into description (poke_id, pokedex_entry) values (21, 'It busily flits around here and there. Even if it is frail, it can be a tough foe that uses MIRROR MOVE.');
insert into description (poke_id, pokedex_entry) values (21, 'Inept at flying high. However, it can fly around very fast to protect its ter ritory.');
insert into description (poke_id, pokedex_entry) values (22, 'With its huge and magnificent wings, it can keep aloft without ever having to land for rest.');
insert into description (poke_id, pokedex_entry) values (22, 'Its huge and magnificent wings can keep it aloft in the sky. It can remain flying a whole day without landing.');
insert into description (poke_id, pokedex_entry) values (22, 'A POKMON that dates back many years. If it senses danger, it flies high and away, instantly.');
insert into description (poke_id, pokedex_entry) values (23, 'Moves silently and stealthily. Eats the eggs of birds, such as PIDGEY and SPEAROW, whole.');
insert into description (poke_id, pokedex_entry) values (23, 'A very common sight in grassland, etc. It flicks its tongue in and out to sense danger in its surroundings.');
insert into description (poke_id, pokedex_entry) values (23, 'The older it gets, the longer it grows. At night, it wraps its long body around tree branches to rest.');
insert into description (poke_id, pokedex_entry) values (24, 'It is rumored that the ferocious warning markings on its belly differ from area to area.');
insert into description (poke_id, pokedex_entry) values (24, 'The pattern on its belly appears to be a frightening face. Weak foes will flee just at the sight of the pattern.');
insert into description (poke_id, pokedex_entry) values (24, 'The frightening patterns on its belly have been studied. Six variations have been confirmed.');
insert into description (poke_id, pokedex_entry) values (25, 'When several of these POKMON gather, their electricity could build and cause lightning storms.');
insert into description (poke_id, pokedex_entry) values (25, 'It has small electric sacs on both its cheeks. If threatened, it looses electric charges from the sacs.');
insert into description (poke_id, pokedex_entry) values (25, 'It keeps its tail raised to monitor its surroundings. If you yank its tail, it will try to bite you.');
insert into description (poke_id, pokedex_entry) values (26, 'Its long tail serves as a ground to protect itself from its own high voltage power.');
insert into description (poke_id, pokedex_entry) values (26, 'Its electric charges can reach even 100,000 volts. Careless contact can cause even an Indian elephant to faint.');
insert into description (poke_id, pokedex_entry) values (26, 'When electricity builds up inside its body, it becomes feisty. It also glows in the dark.');
insert into description (poke_id, pokedex_entry) values (27, 'Burrows deep underground in arid locations far from water. It only emerges to hunt for food.');
insert into description (poke_id, pokedex_entry) values (27, 'It burrows and lives underground. If threatened, it curls itself up into a ball for protection.');
insert into description (poke_id, pokedex_entry) values (27, 'Its body is dry. When it gets cold at night, its hide is said to become coated with a fine dew.');
insert into description (poke_id, pokedex_entry) values (28, 'Curls up into a spiny ball when threatened. It can roll while curled up to attack or escape.');
insert into description (poke_id, pokedex_entry) values (28, 'It is adept at attacking with the spines on its back and its sharp claws while quickly scurrying about.');
insert into description (poke_id, pokedex_entry) values (28, 'It is skilled at slashing enemies with its claws. If broken, they start to grow back in a day.');
insert into description (poke_id, pokedex_entry) values (29, 'Although small, its venomous barbs render this POKMON dangerous. The female has smaller horns.');
insert into description (poke_id, pokedex_entry) values (29, 'Though small, it must be treated with caution because of its powerfully toxic barbs. The female has smaller horns.');
insert into description (poke_id, pokedex_entry) values (29, 'A mild-mannered POKMON that does not like to fight. Beware, its small horns secrete venom.');
insert into description (poke_id, pokedex_entry) values (30, 'The female''s horn develops slowly. Prefers physical attacks such as clawing and biting.');
insert into description (poke_id, pokedex_entry) values (30, 'The female has a gentle temperament. It emits ultrasonic cries that have the power to befuddle foes.');
insert into description (poke_id, pokedex_entry) values (30, 'When resting deep in its burrow, its thorns always retract. This is proof that it is relaxed.');
insert into description (poke_id, pokedex_entry) values (31, 'Its hard scales provide strong protection. It uses its hefty bulk to execute powerful moves.');
insert into description (poke_id, pokedex_entry) values (31, 'The body is covered by stiff, needle- like scales. If it becomes excited, the needles bristle outwards.');
insert into description (poke_id, pokedex_entry) values (31, 'Tough scales cover the sturdy body of this POKMON. It appears that the scales grow in cycles.');
insert into description (poke_id, pokedex_entry) values (32, 'Stiffens its ears to sense danger. The larger its horns, the more powerful its secreted venom.');
insert into description (poke_id, pokedex_entry) values (32, 'Its large ears are flapped like wings when it is listening to distant sounds. It extends toxic barbs when angered.');
insert into description (poke_id, pokedex_entry) values (32, 'Its large ears are always kept upright. If it senses danger, it will attack with a poisonous sting.');
insert into description (poke_id, pokedex_entry) values (33, 'An aggressive POKMON that is quick to attack. The horn on its head secretes a powerful venom.');
insert into description (poke_id, pokedex_entry) values (33, 'It is easily angered. By swinging its well- developed horn wildly, it can even punch through diamond.');
insert into description (poke_id, pokedex_entry) values (33, 'Its horns contain venom. If they are stabbed into an enemy, the impact makes the poison leak out.');
insert into description (poke_id, pokedex_entry) values (34, 'It uses its powerful tail in battle to smash, constrict, then break the prey''s bones.');
insert into description (poke_id, pokedex_entry) values (34, 'It is recognized by its rock-hard hide and its extended horn. Be careful with the horn as it contains venom.');
insert into description (poke_id, pokedex_entry) values (34, 'Its steel-like hide adds to its powerful tackle. Its horns are so hard, they can pierce a diamond.');
insert into description (poke_id, pokedex_entry) values (35, 'Its magical and cute appeal has many admirers. It is rare and found only in certain areas.');
insert into description (poke_id, pokedex_entry) values (35, 'Its adorable appearance makes it popular as a pet. However, it is rare and difficult to find.');
insert into description (poke_id, pokedex_entry) values (35, 'Adored for their cute looks and playfulness. They are thought to be rare, as they do not appear often.');
insert into description (poke_id, pokedex_entry) values (36, 'A timid fairy POKMON that is rarely seen. It will run and hide the moment it senses people.');
insert into description (poke_id, pokedex_entry) values (36, 'It has an acute sense of hearing. It can easily hear a pin being dropped nearly 1,100 yards away.');
insert into description (poke_id, pokedex_entry) values (36, 'They appear to be very protective of their own world. It is a kind of fairy, rarely seen by people.');
insert into description (poke_id, pokedex_entry) values (37, 'At the time of birth, it has just one tail. The tail splits from its tip as it grows older.');
insert into description (poke_id, pokedex_entry) values (37, 'While young, it has six gorgeous tails. When it grows, several new tails are sprouted.');
insert into description (poke_id, pokedex_entry) values (37, 'Both its fur and its tails are beautiful. As it grows, the tails split and form more tails.');
insert into description (poke_id, pokedex_entry) values (38, 'Very smart and very vengeful. Grabbing one of its many tails could result in a 1000-year curse.');
insert into description (poke_id, pokedex_entry) values (38, 'It has nine long tails and fur that  gleams gold. It is said to live for  1,000 years.');
insert into description (poke_id, pokedex_entry) values (38, 'According to an enduring legend, 9 noble saints were united and reincarnated as this POKMON.');
insert into description (poke_id, pokedex_entry) values (39, 'When its huge eyes light up, it sings a mysteriously soothing melody that lulls its enemies to sleep.');
insert into description (poke_id, pokedex_entry) values (39, 'It captivates foes with its huge, round eyes, then lulls them to sleep by singing a soothing melody.');
insert into description (poke_id, pokedex_entry) values (39, 'Uses its alluring eyes to enrapture its foe. It then sings a pleasing melody that lulls the foe to sleep.');
insert into description (poke_id, pokedex_entry) values (40, 'The body is soft and rubbery. When angered, it will suck in air and inflate itself to an enormous size.');
insert into description (poke_id, pokedex_entry) values (40, 'Its fur is extremely fine, dense, and supple. The exquisitely pleasant fur conveys an image of luxury.');
insert into description (poke_id, pokedex_entry) values (40, 'Its body is full of elasticity. By inhaling deeply, it can continue to inflate itself without limit.');
insert into description (poke_id, pokedex_entry) values (41, 'Forms colonies in perpetually dark places. Uses ultrasonic waves to identify and approach targets.');
insert into description (poke_id, pokedex_entry) values (41, 'It has no eyes. Instead, it relies on its ultrasonic cries for echo location to flit about in darkness.');
insert into description (poke_id, pokedex_entry) values (41, 'Emits ultrasonic cries while it flies. They act as a sonar used to check for ob jects in its way.');
insert into description (poke_id, pokedex_entry) values (42, 'Once it strikes, it will not stop draining energy from the victim even if it gets too heavy to fly.');
insert into description (poke_id, pokedex_entry) values (42, 'It clamps down on its prey with needle- sharp fangs and drains over 10 ounces of blood in one gulp.');
insert into description (poke_id, pokedex_entry) values (42, 'It attacks in a stealthy manner, without warning. Its sharp fangs are used to bite and suck blood.');
insert into description (poke_id, pokedex_entry) values (43, 'During the day, it keeps its face buried in the ground. At night, it wanders around sowing its seeds.');
insert into description (poke_id, pokedex_entry) values (43, 'Its scientific name is Oddium Wanderus. At night, it is said to walk nearly 1,000 feet on its two roots.');
insert into description (poke_id, pokedex_entry) values (43, 'It may be mistaken for a clump of weeds. If you try to yank it out of the ground, it shrieks horribly.');
insert into description (poke_id, pokedex_entry) values (44, 'The fluid that oozes from its mouth isn''t drool. It is a nectar that is used to attract prey.');
insert into description (poke_id, pokedex_entry) values (44, 'Its pistils exude an incredibly foul odor. The horrid stench can cause fainting at a distance of 1.25 miles.');
insert into description (poke_id, pokedex_entry) values (44, 'Smells incredibly foul! However, around 1 out of 1,000 people enjoy sniffing its nose- bending stink.');
insert into description (poke_id, pokedex_entry) values (45, 'The larger its petals, the more toxic pollen it contains. Its big head is heavy and hard to hold up.');
insert into description (poke_id, pokedex_entry) values (45, 'Its petals are the largest in the world. It fiendishly scatters allergy-causing pollen from its petals.');
insert into description (poke_id, pokedex_entry) values (45, 'Flaps its broad flower petals to scatter its poisonous pollen. The flapping sound is very loud.');
insert into description (poke_id, pokedex_entry) values (46, 'Burrows to suck tree roots. The mushrooms on its back grow by draw ing nutrients from the bug host.');
insert into description (poke_id, pokedex_entry) values (46, 'Growing out of the bugs back are mushrooms called tochukaso. The mushrooms grow with the bug host.');
insert into description (poke_id, pokedex_entry) values (46, 'Burrows under the ground to gnaw on tree roots. The mushrooms on its back absorb most of the nutrition.');
insert into description (poke_id, pokedex_entry) values (47, 'A host-parasite pair in which the parasite mushroom has taken over the host bug. Prefers damp places.');
insert into description (poke_id, pokedex_entry) values (47, 'It scatters toxic spores from the mushroom cap. In China, the spores are used as herbal medicine.');
insert into description (poke_id, pokedex_entry) values (47, 'The bug host is drained of energy by the mushrooms on its back. They appear to do all the thinking.');
insert into description (poke_id, pokedex_entry) values (48, 'Lives in the shadows of tall trees where it eats insects. It is attracted by light at night.');
insert into description (poke_id, pokedex_entry) values (48, 'Its eyes act as radar, enabling it to be active in darkness. The eyes can also shoot powerful beams.');
insert into description (poke_id, pokedex_entry) values (48, 'Its large eyes act as radars. In a bright place, you can see that they are clusters of many tiny eyes.');
insert into description (poke_id, pokedex_entry) values (49, 'The dust-like scales covering its wings are color coded to indicate the kinds of poison it has.');
insert into description (poke_id, pokedex_entry) values (49, 'The wings are covered with dustlike scales. Every time it flaps its wings, it looses highly toxic dust.');
insert into description (poke_id, pokedex_entry) values (49, 'The powdery scales on its wings are hard to remove. They also contain poison that leaks out on contact.');
insert into description (poke_id, pokedex_entry) values (50, 'Lives about one yard underground where it feeds on plant roots. It sometimes appears above ground.');
insert into description (poke_id, pokedex_entry) values (50, 'It burrows through the ground at a shallow depth. It leaves raised earth in its wake, making it easy to spot.');
insert into description (poke_id, pokedex_entry) values (50, 'It prefers dark places. It spends most of its time underground, though it may pop up in caves.');
insert into description (poke_id, pokedex_entry) values (51, 'A team of DIGLETT triplets. It triggers huge earthquakes by burrowing 60 miles underground.');
insert into description (poke_id, pokedex_entry) values (51, 'In battle, it digs through the ground and strikes the unsuspecting foe from an unexpected direction.');
insert into description (poke_id, pokedex_entry) values (51, 'A team of triplets that can burrow over 60 MPH. Due to this, some people think it''s an earthquake.');
insert into description (poke_id, pokedex_entry) values (52, 'Adores circular objects. Wanders the streets on a nightly basis to look for dropped loose change.');
insert into description (poke_id, pokedex_entry) values (52, 'All it does is sleep during the daytime. At night, it patrols its territory with its eyes aglow.');
insert into description (poke_id, pokedex_entry) values (52, 'Appears to be more active at night. It loves round and shiny things. It can''t stop from picking them up.');
insert into description (poke_id, pokedex_entry) values (53, 'Although its fur has many admirers, it is tough to raise as a pet because of its fickle meanness.');
insert into description (poke_id, pokedex_entry) values (53, 'Has a vicious temperament. Beware if it raises its tail straight up. It is a signal that it is about to pounce and bite.');
insert into description (poke_id, pokedex_entry) values (53, 'The gem in its forehead glows on its own! It walks with all the grace and elegance of a proud queen.');
insert into description (poke_id, pokedex_entry) values (54, 'While lulling its enemies with its vacant look, this wily POKMON will use psychokinetic powers.');
insert into description (poke_id, pokedex_entry) values (54, 'It is constantly wracked by a headache. When the headache turns intense, it begins using mysterious powers.');
insert into description (poke_id, pokedex_entry) values (54, 'Always tormented by headaches. It uses psychic powers, but it is not known if it intends to do so.');
insert into description (poke_id, pokedex_entry) values (55, 'Often seen swim ming elegantly by lake shores. It is often mistaken for the Japanese monster, Kappa.');
insert into description (poke_id, pokedex_entry) values (55, 'The forelegs are webbed, helping to make it an adept swimmer. It can be seen swimming elegantly in lakes, etc.');
insert into description (poke_id, pokedex_entry) values (55, 'Its slim and long limbs end in broad flippers. They are used for swim ming gracefully in lakes.');
insert into description (poke_id, pokedex_entry) values (56, 'Extremely quick to anger. It could be docile one moment then thrashing away the next instant.');
insert into description (poke_id, pokedex_entry) values (56, 'Light and agile on its feet, and ferocious in temperament. When angered, it flies into an uncontrollable frenzy.');
insert into description (poke_id, pokedex_entry) values (56, 'An agile POKMON that lives in trees. It angers easily and will not hesitate to attack anything.');
insert into description (poke_id, pokedex_entry) values (57, 'Always furious and tenacious to boot. It will not abandon chasing its quarry until it is caught.');
insert into description (poke_id, pokedex_entry) values (57, 'It is always outrageously furious. If it gives chase, it will tenaciously track the target no matter how far.');
insert into description (poke_id, pokedex_entry) values (57, 'It stops being angry only when nobody else is around. To view this moment is very difficult.');
insert into description (poke_id, pokedex_entry) values (58, 'Very protective of its territory. It will bark and bite to repel intruders from its space.');
insert into description (poke_id, pokedex_entry) values (58, 'Very friendly and faithful to people. It will try to repel enemies by barking and biting.');
insert into description (poke_id, pokedex_entry) values (58, 'A POKMON with a friendly nature. However, it will bark fiercely at anything invading its territory.');
insert into description (poke_id, pokedex_entry) values (59, 'A POKMON that has been admired since the past for its beauty. It runs agilely as if on wings.');
insert into description (poke_id, pokedex_entry) values (59, 'A POKMON that is described in Chinese legends. It is said to race at an unbelievable speed.');
insert into description (poke_id, pokedex_entry) values (59, 'A legendary POK MON in China. Many people are charmed by its grace and beauty while running.');
insert into description (poke_id, pokedex_entry) values (60, 'Its newly grown legs prevent it from running. It appears to prefer swimming than trying to stand.');
insert into description (poke_id, pokedex_entry) values (60, 'Its slick black skin is thin and damp. A part of its internal organs can be seen through the skin as a spiral pattern.');
insert into description (poke_id, pokedex_entry) values (60, 'The direction of the spiral on the belly differs by area. It is more adept at swimming than walking.');
insert into description (poke_id, pokedex_entry) values (61, 'Capable of living in or out of water. When out of water, it sweats to keep its body slimy.');
insert into description (poke_id, pokedex_entry) values (61, 'Its two legs are well developed. Even though it can live on the ground, it prefers living in water.');
insert into description (poke_id, pokedex_entry) values (61, 'Under attack, it uses its belly  spiral to put the foe to sleep. It then makes its escape.');
insert into description (poke_id, pokedex_entry) values (62, 'An adept swimmer at both the front crawl and breast stroke. Easily overtakes the best human swimmers.');
insert into description (poke_id, pokedex_entry) values (62, 'An adept swimmer, it knows the front crawl, butterfly, and more. It is faster than the best human swimmers.');
insert into description (poke_id, pokedex_entry) values (62, 'Swims powerfully using all the muscles in its body. It can even overtake champion swimmers.');
insert into description (poke_id, pokedex_entry) values (63, 'Using its ability to read minds, it will identify impending danger and TELEPORT to safety.');
insert into description (poke_id, pokedex_entry) values (63, 'It sleeps for 18 hours a day. It uses a variety of extrasensory powers even while asleep.');
insert into description (poke_id, pokedex_entry) values (63, 'Sleeps 18 hours a day. If it senses danger, it will teleport itself to safety even as it sleeps.');
insert into description (poke_id, pokedex_entry) values (64, 'It emits special alpha waves from its body that induce headaches just by being close by.');
insert into description (poke_id, pokedex_entry) values (64, 'It happened one morning - a boy with extrasensory powers awoke in bed transformed into KADABRA.');
insert into description (poke_id, pokedex_entry) values (64, 'Many odd things happen if this POKMON is close by. For example, it makes clocks run backwards.');
insert into description (poke_id, pokedex_entry) values (65, 'Its brain can out perform a super computer. Its intelligence quotient is said to be 5,000.');
insert into description (poke_id, pokedex_entry) values (65, 'It does not like physical attacks very  much. Instead, it freely uses extra sensory powers to defeat foes.');
insert into description (poke_id, pokedex_entry) values (65, 'A POKMON that can memorize anything. It never forgets what it learns-- that''s why this POKMON is smart.');
insert into description (poke_id, pokedex_entry) values (66, 'Loves to build its muscles. It trains in all styles of martial arts to become even stronger.');
insert into description (poke_id, pokedex_entry) values (66, 'Its whole body is composed of muscles. Even though its the size of a human child, it can hurl 100 grown-ups.');
insert into description (poke_id, pokedex_entry) values (66, 'Very powerful in spite of its small size. Its mastery of many types of martial arts makes it very tough.');
insert into description (poke_id, pokedex_entry) values (67, 'Its muscular body is so powerful, it must wear a power save belt to be able to regulate its motions.');
insert into description (poke_id, pokedex_entry) values (67, 'Its formidable body never gets tired. It helps people by doing work such as the moving of heavy goods.');
insert into description (poke_id, pokedex_entry) values (67, 'The belt around its waist holds back its energy. Without it, this POKMON would be unstoppable.');
insert into description (poke_id, pokedex_entry) values (68, 'Using its heavy muscles, it throws powerful punches that can send the victim clear over the horizon.');
insert into description (poke_id, pokedex_entry) values (68, 'Its four ruggedly developed arms can launch a flurry of 1,000 punches in just two seconds.');
insert into description (poke_id, pokedex_entry) values (68, 'One arm alone can move mountains. Using all four arms, this POKMON fires off awesome punches.');
insert into description (poke_id, pokedex_entry) values (69, 'A carnivorous POKMON that traps and eats bugs. It uses its root feet to soak up needed moisture.');
insert into description (poke_id, pokedex_entry) values (69, 'Its bud looks like a human face. Because of the bud, it is rumored to be a type of legendary mandrake plant.');
insert into description (poke_id, pokedex_entry) values (69, 'Prefers hot and humid places. It ensnares tiny insects with its vines and devours them.');
insert into description (poke_id, pokedex_entry) values (70, 'It spits out POISONPOWDER to immobilize the enemy and then finishes it with a spray of ACID.');
insert into description (poke_id, pokedex_entry) values (70, 'The leafy parts act as cutters for slashing foes. It spits a fluid that dissolves everything.');
insert into description (poke_id, pokedex_entry) values (70, 'When hungry, it swallows anything that moves. Its hapless prey is melted inside by strong acids.');
insert into description (poke_id, pokedex_entry) values (71, 'Said to live in huge colonies deep in jungles, although no one has ever returned from there.');
insert into description (poke_id, pokedex_entry) values (71, 'Lures prey into its mouth with a honeylike aroma. The helpless prey is melted with a dissolving fluid.');
insert into description (poke_id, pokedex_entry) values (71, 'Lures prey with the sweet aroma of honey. Swallowed whole, the prey is melted in a day, bones and all.');
insert into description (poke_id, pokedex_entry) values (72, 'Drifts in shallow seas. Anglers who hook them by accident are often punished by its stinging acid.');
insert into description (poke_id, pokedex_entry) values (72, 'Its eyes are as transparent as crystals. From them, it shoots mysterious beams of light.');
insert into description (poke_id, pokedex_entry) values (72, 'It can sometimes be found all dry and shriveled up on a beach. Toss it back into the sea to revive it.');
insert into description (poke_id, pokedex_entry) values (73, 'The tentacles are normally kept short. On hunts, they are extended to ensnare and immobilize prey.');
insert into description (poke_id, pokedex_entry) values (73, 'It has 80 tentacles that move about freely. They can sting, causing poisoning and sharp, stabbing pain.');
insert into description (poke_id, pokedex_entry) values (73, 'Its 80 tentacles can stretch and contract freely. They wrap around prey and weaken it with poison.');
insert into description (poke_id, pokedex_entry) values (74, 'Found in fields and mountains. Mistaking them for boulders, people often step or trip on them.');
insert into description (poke_id, pokedex_entry) values (74, 'Its round form makes it easy to pick up. Some people have used them to hurl at each other in a snowball fight.');
insert into description (poke_id, pokedex_entry) values (74, 'Commonly found near mountain trails, etc. If you step on one by accident, it gets angry.');
insert into description (poke_id, pokedex_entry) values (75, 'Rolls down slopes to move. It rolls over any obstacle without slowing or changing its direction.');
insert into description (poke_id, pokedex_entry) values (75, 'Be careful while hiking on mountain trails. GRAVELER may come rolling down the path without slowing.');
insert into description (poke_id, pokedex_entry) values (75, 'Often seen rolling down mountain trails. Obstacles are just things to roll straight over, not avoid.');
insert into description (poke_id, pokedex_entry) values (76, 'Its boulder-like body is extremely hard. It can easily withstand dynamite blasts without damage.');
insert into description (poke_id, pokedex_entry) values (76, 'It is enclosed in a hard shell that is as rugged as slabs of rock. It sheds skin once a year to grow larger.');
insert into description (poke_id, pokedex_entry) values (76, 'Once it sheds its skin, its body turns tender and whitish. Its hide hardens when it''s exposed to air.');
insert into description (poke_id, pokedex_entry) values (77, 'Its hooves are 10 times harder than diamonds. It can trample anything completely flat in little time.');
insert into description (poke_id, pokedex_entry) values (77, 'Its body is light, and its legs are incredibly powerful. It can clear Ayers Rock in one leap.');
insert into description (poke_id, pokedex_entry) values (77, 'Capable of jumping incredibly high. Its hooves and sturdy legs absorb the impact of a hard landing.');
insert into description (poke_id, pokedex_entry) values (78, 'Very competitive, this POKMON will chase anything that moves fast in the hopes of racing it.');
insert into description (poke_id, pokedex_entry) values (78, 'It can gallop at a top speed of 150 miles per hour. It can race as fast as a bullet train while ablaze.');
insert into description (poke_id, pokedex_entry) values (78, 'Just loves to run. If it sees some thing faster than itself, it will give chase at top speed.');
insert into description (poke_id, pokedex_entry) values (79, 'Incredibly slow and dopey. It takes 5 seconds for it to feel pain when under attack.');
insert into description (poke_id, pokedex_entry) values (79, 'It is always vacantly lost in thought, but no one knows what it is thinking about. It is good at fishing with its tail.');
insert into description (poke_id, pokedex_entry) values (79, 'Incredibly slow and sluggish. It is quite content to loll about without worrying about the time.');
insert into description (poke_id, pokedex_entry) values (80, 'The SHELLDER that is latched onto SLOWPOKE''s tail is said to feed on the host''s left over scraps.');
insert into description (poke_id, pokedex_entry) values (80, 'When a SLOWPOKE went hunting in the sea, its tail was bitten by a SHELLDER. That made it evolve into SLOWBRO.');
insert into description (poke_id, pokedex_entry) values (80, 'Lives lazily by the sea. If the SHELLDER on its tail comes off, it becomes a SLOWPOKE again.');
insert into description (poke_id, pokedex_entry) values (81, 'Uses anti-gravity to stay suspended. Appears without warning and uses THUNDER WAVE and similar moves.');
insert into description (poke_id, pokedex_entry) values (81, 'It moves while constantly hovering. It discharges THUNDER WAVE and so on from the units at its sides.');
insert into description (poke_id, pokedex_entry) values (81, 'It is born with the ability to defy gravity. It floats in air on powerful electro magnetic waves.');
insert into description (poke_id, pokedex_entry) values (82, 'Formed by several MAGNEMITEs linked together. They frequently appear when sunspots flare up.');
insert into description (poke_id, pokedex_entry) values (82, 'A linked cluster formed of several MAGNEMITE. It discharges powerful magnetic waves at high voltage.');
insert into description (poke_id, pokedex_entry) values (82, 'Generates strange radio signals. It raises the tem perature by 3.6F degrees within 3,300 feet.');
insert into description (poke_id, pokedex_entry) values (83, 'The sprig of green onions it holds is its weapon. It is used much like a metal sword.');
insert into description (poke_id, pokedex_entry) values (83, 'It always walks about with a plant stalk clamped in its beak. The stalk is used for building its nest.');
insert into description (poke_id, pokedex_entry) values (83, 'Lives where reedy plants grow. They are rarely seen, so it''s thought their numbers are decreasing.');
insert into description (poke_id, pokedex_entry) values (84, 'A bird that makes up for its poor flying with its fast foot speed. Leaves giant footprints.');
insert into description (poke_id, pokedex_entry) values (84, 'A two-headed POKMON that was discovered as a sudden mutation. It runs at a pace of over 60 miles per hour.');
insert into description (poke_id, pokedex_entry) values (84, 'Its short wings make flying dif ficult. Instead, this POKMON runs at high speed on developed legs.');
insert into description (poke_id, pokedex_entry) values (85, 'Uses its three brains to execute complex plans. While two heads sleep, one head stays awake.');
insert into description (poke_id, pokedex_entry) values (85, 'An odd species that is rarely found. The three heads respectively represent joy, sadness, and anger.');
insert into description (poke_id, pokedex_entry) values (85, 'One of DODUO''s 2 heads splits to form a unique species. It runs close to 40 MPH in prairies.');
insert into description (poke_id, pokedex_entry) values (86, 'The protruding horn on its head is very hard. It is used for bashing through thick ice.');
insert into description (poke_id, pokedex_entry) values (86, 'Covered with light blue fur, its hide is thick and tough. It is active in bitter cold of minus 40 degrees Fahrenheit.');
insert into description (poke_id, pokedex_entry) values (86, 'Loves freezing cold conditions. Relishes swimming in a frigid cli mate of around 14F degrees.');
insert into description (poke_id, pokedex_entry) values (87, 'Stores thermal energy in its body. Swims at a steady 8 knots even in intensely cold waters.');
insert into description (poke_id, pokedex_entry) values (87, 'Its body is covered with a pure white fur. The colder the weather, the more active it becomes.');
insert into description (poke_id, pokedex_entry) values (87, 'Its entire body is a snowy-white. Unharmed by even intense cold, it swims powerfully in icy waters.');
insert into description (poke_id, pokedex_entry) values (88, 'Appears in filthy areas. Thrives by sucking up polluted sludge that is pumped out of factories.');
insert into description (poke_id, pokedex_entry) values (88, 'Sludge exposed to X rays from the moon transformed into GRIMER. It loves feeding on filthy things.');
insert into description (poke_id, pokedex_entry) values (88, 'Made of hardened sludge. It smells too putrid to touch. Even weeds won''t grow in its path.');
insert into description (poke_id, pokedex_entry) values (89, 'Thickly covered with a filthy, vile sludge. It is so toxic, even its footprints contain poison.');
insert into description (poke_id, pokedex_entry) values (89, 'It is usually undetectable because it blends in with the ground. Touching it can cause terrible poisoning.');
insert into description (poke_id, pokedex_entry) values (89, 'Smells so awful, it can cause fainting. Through degeneration, it lost its sense of smell.');
insert into description (poke_id, pokedex_entry) values (90, 'Its hard shell repels any kind of attack. It is vulnerable only when its shell is open.');
insert into description (poke_id, pokedex_entry) values (90, 'It is encased in a shell that is harder than diamond. Inside, however, it is surprisingly tender.');
insert into description (poke_id, pokedex_entry) values (90, 'The shell can withstand any attack. However, when it is open, the tender body is exposed.');
insert into description (poke_id, pokedex_entry) values (91, 'When attacked, it launches its horns in quick volleys. Its innards have never been seen.');
insert into description (poke_id, pokedex_entry) values (91, 'Its shell is extremely hard. It cannot be shattered, even with a bomb. The shell opens only when it is attacking.');
insert into description (poke_id, pokedex_entry) values (91, 'For protection, it uses its harder- than-diamonds shell. It also shoots spikes from the shell.');
insert into description (poke_id, pokedex_entry) values (92, 'Almost invisible, this gaseous POKMON cloaks the target and puts it to sleep without notice.');
insert into description (poke_id, pokedex_entry) values (92, 'A being that exists as a thin gas. It can topple an Indian elephant by enveloping the prey in two seconds.');
insert into description (poke_id, pokedex_entry) values (92, 'Said to appear in decrepit, deserted buildings. It has no real shape as it appears to be made of a gas.');
insert into description (poke_id, pokedex_entry) values (93, 'Because of its ability to slip through block walls, it is said to be from an other dimension.');
insert into description (poke_id, pokedex_entry) values (93, 'If you get the feeling of being watched in darkness when nobody is around, HAUNTER is there.');
insert into description (poke_id, pokedex_entry) values (93, 'By licking, it saps the victim''s life. It causes shaking that won''t stop until the victim''s demise.');
insert into description (poke_id, pokedex_entry) values (94, 'Under a full moon, this POKMON likes to mimic the shadows of people and laugh at their fright.');
insert into description (poke_id, pokedex_entry) values (94, 'It is said to emerge from darkness to steal the lives of those who become lost in mountains.');
insert into description (poke_id, pokedex_entry) values (94, 'A GENGAR is close by if you feel a sudden chill. It may be trying to lay a curse on you.');
insert into description (poke_id, pokedex_entry) values (95, 'As it grows, the stone portions of its body harden to become similar to a diamond, but colored black.');
insert into description (poke_id, pokedex_entry) values (95, 'It usually lives underground. It searches for food while boring its way through the ground at 50 miles per hour.');
insert into description (poke_id, pokedex_entry) values (95, 'Burrows at high speed in search of food. The tunnels it leaves are used as homes by DIGLETTs.');
insert into description (poke_id, pokedex_entry) values (96, 'Puts enemies to sleep then eats their dreams. Occasionally gets sick from eating bad dreams.');
insert into description (poke_id, pokedex_entry) values (96, 'A descendent of the legendary animal baku, which is said to eat dreams. It is skilled at hypnotism.');
insert into description (poke_id, pokedex_entry) values (96, 'If you sleep by it all the time, it will sometimes show you dreams it has eaten in the past.');
insert into description (poke_id, pokedex_entry) values (97, 'When it locks eyes with an enemy, it will use a mix of PSI moves such as HYPNOSIS and CONFUSION.');
insert into description (poke_id, pokedex_entry) values (97, 'It carries a pendulum-like device. There once was an incident in which it took  away a child it hypnotized.');
insert into description (poke_id, pokedex_entry) values (97, 'Avoid eye contact if you come across one. It will try to put you to sleep by using its pendulum.');
insert into description (poke_id, pokedex_entry) values (98, 'Its pincers are not only powerful weapons, they are used for balance when walking sideways.');
insert into description (poke_id, pokedex_entry) values (98, 'It can be found near the sea. The large pincers grow back if they are torn out of their sockets.');
insert into description (poke_id, pokedex_entry) values (98, 'Its pincers are superb weapons. They sometimes break off during battle, but they grow back fast.');
insert into description (poke_id, pokedex_entry) values (99, 'The large pincer has 10000 hp of crushing power. However, its huge size makes it unwieldy to use.');
insert into description (poke_id, pokedex_entry) values (99, 'Its large and hard pincer has 10,000- horsepower strength. However, being so big, it is unwieldy to move.');
insert into description (poke_id, pokedex_entry) values (99, 'One claw grew massively and as hard as steel. It has 10,000-HP strength. However, it is too heavy.');
insert into description (poke_id, pokedex_entry) values (100, 'Usually found in power plants. Easily mistaken for a POK BALL, they have zapped many people.');
insert into description (poke_id, pokedex_entry) values (100, 'A life-form whose identity is unknown. It is said to SCREECH or suddenly SELFDESTRUCT.');
insert into description (poke_id, pokedex_entry) values (100, 'It is said to camouflage itself as a POK BALL. It will self-destruct with very little stimulus.');
insert into description (poke_id, pokedex_entry) values (101, 'It stores electric energy under very high pressure. It often explodes with little or no provocation.');
insert into description (poke_id, pokedex_entry) values (101, 'It explodes in response to even minor stimuli. It is feared, with the nickname of The Bomb Ball.');
insert into description (poke_id, pokedex_entry) values (101, 'Stores electrical energy inside its body. Even the slightest shock could trigger a huge explosion.');
insert into description (poke_id, pokedex_entry) values (102, 'Often mistaken for eggs. When disturbed, they quickly gather and attack in swarms.');
insert into description (poke_id, pokedex_entry) values (102, 'Even though it appears to be eggs of some sort, it was discovered to be a life- form more like plant seeds.');
insert into description (poke_id, pokedex_entry) values (102, 'The heads attract each other and spin around. There must be 6 heads for it to maintain balance.');
insert into description (poke_id, pokedex_entry) values (103, 'Legend has it that on rare occasions, one of its heads will drop off and continue on as an EXEGGCUTE.');
insert into description (poke_id, pokedex_entry) values (103, 'It is called The Walking Tropical Rainforest. Each of the nuts has a face and a will of its own.');
insert into description (poke_id, pokedex_entry) values (103, 'Its cries are very noisy. This is because each of the 3 heads thinks about whatever it likes.');
insert into description (poke_id, pokedex_entry) values (104, 'Because it never removes its skull helmet, no one has ever seen this POKMON''s real face.');
insert into description (poke_id, pokedex_entry) values (104, 'It wears the skull of its dead mother on its head. When it becomes lonesome, it is said to cry loudly.');
insert into description (poke_id, pokedex_entry) values (104, 'Wears the skull of its deceased mother. Its cries echo inside the skull and come out as a sad melody.');
insert into description (poke_id, pokedex_entry) values (105, 'The bone it holds is its key weapon. It throws the bone skillfully like a boomerang to KO targets.');
insert into description (poke_id, pokedex_entry) values (105, 'It is small and was originally very weak. Its temperament turned ferocious when it began using bones.');
insert into description (poke_id, pokedex_entry) values (105, 'Small and weak, this POKMON is adept with its bone club. It has grown more vicious over the ages.');
insert into description (poke_id, pokedex_entry) values (106, 'When in a hurry, its legs lengthen progressively. It runs smoothly with extra long, loping strides.');
insert into description (poke_id, pokedex_entry) values (106, 'The legs freely contract and stretch. The stretchy legs allow it to hit a distant foe with a rising kick.');
insert into description (poke_id, pokedex_entry) values (106, 'When kicking, the sole of its foot turns as hard as a diamond on im pact and destroys its enemy.');
insert into description (poke_id, pokedex_entry) values (107, 'While apparently doing nothing, it fires punches in lightning fast volleys that are impossible to see.');
insert into description (poke_id, pokedex_entry) values (107, 'The spirit of a pro boxer has infused this POKMON. It throws punches that are faster than a bullet train.');
insert into description (poke_id, pokedex_entry) values (107, 'Punches in cork screw fashion. It can punch its way through a concrete wall in the same way as a drill.');
insert into description (poke_id, pokedex_entry) values (108, 'Its tongue can be extended like a chameleon''s. It leaves a tingling sensation when it licks enemies.');
insert into description (poke_id, pokedex_entry) values (108, 'Its tongue is twice the length of its body. It can be moved like an arm for grabbing food and attacking.');
insert into description (poke_id, pokedex_entry) values (108, 'Its tongue spans almost 7 feet and moves more freely than its forelegs. Its licks can cause paralysis.');
insert into description (poke_id, pokedex_entry) values (109, 'Because it stores several kinds of toxic gases in its body, it is prone to exploding without warning.');
insert into description (poke_id, pokedex_entry) values (109, 'Its thin, balloon-like body is inflated by horribly toxic gases. It reeks when it is nearby.');
insert into description (poke_id, pokedex_entry) values (109, 'In hot places, its internal gases could expand and explode without any warning. Be very careful!');
insert into description (poke_id, pokedex_entry) values (110, 'Where two kinds of poison gases meet, 2 KOFFINGs can fuse into a WEEZING over many years.');
insert into description (poke_id, pokedex_entry) values (110, 'Very rarely, a sudden mutation can result in two small KOFFING twins becoming conjoined as a WEEZING.');
insert into description (poke_id, pokedex_entry) values (110, 'It lives and grows by absorbing dust, germs and poison gases that are contained in toxic waste and garbage.');
insert into description (poke_id, pokedex_entry) values (111, 'Its massive bones are 1000 times harder than human bones. It can easily knock a trailer flying.');
insert into description (poke_id, pokedex_entry) values (111, 'Strong, but not too bright, this POKMON can shatter even a skyscraper with its charging TACKLES.');
insert into description (poke_id, pokedex_entry) values (111, 'A POKMON with a one-track mind. Once it charges,  it won''t stop running until it falls asleep.');
insert into description (poke_id, pokedex_entry) values (112, 'Protected by an armor-like hide, it is capable of living in molten lava of 3,600 degrees.');
insert into description (poke_id, pokedex_entry) values (112, 'It begins walking on its hind legs after evolution. It can punch holes through boulders with its horn.');
insert into description (poke_id, pokedex_entry) values (112, 'Walks on its hind legs. Shows signs of intelligence. Its armor-like hide even repels molten lava.');
insert into description (poke_id, pokedex_entry) values (113, 'A rare and elusive POKMON that is said to bring happiness to those who manage to get it.');
insert into description (poke_id, pokedex_entry) values (113, 'It lays several eggs a day. The eggs are apparently rich in nutrients and extremely delicious.');
insert into description (poke_id, pokedex_entry) values (113, 'A gentle and kind hearted POKMON that shares its nutritious eggs if it sees an injured POKMON.');
insert into description (poke_id, pokedex_entry) values (114, 'The whole body is swathed with wide vines that are similar to sea weed. Its vines shake as it walks.');
insert into description (poke_id, pokedex_entry) values (114, 'Blue plant vines cloak the POKMONs identity in a tangled mass. It entangles anything that gets close.');
insert into description (poke_id, pokedex_entry) values (114, 'Its identity is obscured by masses of thick, blue vines. The vines are said to never stop growing.');
insert into description (poke_id, pokedex_entry) values (115, 'The infant rarely ventures out of its mother''s protective pouch until it is 3 years old.');
insert into description (poke_id, pokedex_entry) values (115, 'The female raises its offspring in a pouch on its belly. It is skilled at attacking using COMET PUNCH.');
insert into description (poke_id, pokedex_entry) values (115, 'Raises its young in its belly pouch. Won''t run from any fight to keep its young protected.');
insert into description (poke_id, pokedex_entry) values (116, 'Known to shoot down flying bugs with precision blasts of ink from the surface of the water.');
insert into description (poke_id, pokedex_entry) values (116, 'It maintains balance using its tail, which is wound up like a coil. It may spray ink from its mouth.');
insert into description (poke_id, pokedex_entry) values (116, 'If it senses any danger, it will vigorously spray water or a special type of ink from its mouth.');
insert into description (poke_id, pokedex_entry) values (117, 'Capable of swim ming backwards by rapidly flapping its wing-like pectoral fins and stout tail.');
insert into description (poke_id, pokedex_entry) values (117, 'Its body bristles with sharp spikes. Carelessly trying to touch it could cause fainting from the spikes.');
insert into description (poke_id, pokedex_entry) values (117, 'Touching the back fin causes numb ness. It hooks its tail to coral to stay in place while sleeping.');
insert into description (poke_id, pokedex_entry) values (118, 'Its tail fin billows like an elegant ballroom dress, giving it the nickname of the Water Queen.');
insert into description (poke_id, pokedex_entry) values (118, 'Its dorsal and pectoral fins are strongly developed like muscles. It can swim at a speed of five knots.');
insert into description (poke_id, pokedex_entry) values (118, 'When it is time for them to lay eggs, they can be seen swimming up rivers and falls in large groups.');
insert into description (poke_id, pokedex_entry) values (119, 'In the autumn spawning season, they can be seen swimming power fully up rivers and creeks.');
insert into description (poke_id, pokedex_entry) values (119, 'The horn on its head is sharp like a drill. It bores a hole in a boulder to make its nest.');
insert into description (poke_id, pokedex_entry) values (119, 'It is the male''s job to make a nest by carving out boulders in a stream using the horn on its head.');
insert into description (poke_id, pokedex_entry) values (120, 'An enigmatic POKMON that can effortlessly regenerate any appendage it loses in battle.');
insert into description (poke_id, pokedex_entry) values (120, 'It appears in large numbers by seashores. At night, its central core flashes with a red light.');
insert into description (poke_id, pokedex_entry) values (120, 'As long as the center section is unharmed, it can grow back fully even if it is chopped to bits.');
insert into description (poke_id, pokedex_entry) values (121, 'Its central core glows with the seven colors of the rainbow. Some people value the core as a gem.');
insert into description (poke_id, pokedex_entry) values (121, 'This POKMON has a geometric body. Because of its body, the locals suspect that it is an alien creature.');
insert into description (poke_id, pokedex_entry) values (121, 'The center section is named the core. People think it is communicating when it glows in 7 colors.');
insert into description (poke_id, pokedex_entry) values (122, 'If interrupted while it is miming, it will slap around the offender with its broad hands.');
insert into description (poke_id, pokedex_entry) values (122, 'It is adept at conning people. It is said to be able to create walls out of thin air by miming.');
insert into description (poke_id, pokedex_entry) values (122, 'Always practices its pantomime act. It makes enemies believe something exists that really doesn''t.');
insert into description (poke_id, pokedex_entry) values (123, 'With ninja-like agility and speed, it can create the illusion that there is more than one.');
insert into description (poke_id, pokedex_entry) values (123, 'It tears and shreds prey with its wickedly sharp scythes. It very rarely spreads its wings to fly.');
insert into description (poke_id, pokedex_entry) values (123, 'Leaps out of tall grass and slices prey with its scythes. The move ment looks like that of a ninja.');
insert into description (poke_id, pokedex_entry) values (124, 'It seductively wiggles its hips as it walks. It can cause people to dance in unison with it.');
insert into description (poke_id, pokedex_entry) values (124, 'It speaks using a language that sounds human. Research is under way to determine what is being said.');
insert into description (poke_id, pokedex_entry) values (124, 'Appears to move to a rhythm of its own, as if it were dancing. It wiggles its hips as it walks.');
insert into description (poke_id, pokedex_entry) values (125, 'Normally found near power plants, they can wander away and cause major blackouts in cities.');
insert into description (poke_id, pokedex_entry) values (125, 'It loves to feed on strong electricity. It occasionally appears around large power plants and so on.');
insert into description (poke_id, pokedex_entry) values (125, 'If a major power outage occurs, it is certain that this POKMON has eaten electricity at a power plant.');
insert into description (poke_id, pokedex_entry) values (126, 'Its body always burns with an orange glow that enables it to hide perfectly among flames.');
insert into description (poke_id, pokedex_entry) values (126, 'Found near the mouth of a volcano. This fire-breathers body temperature is nearly 2,200 degrees Fahrenheit.');
insert into description (poke_id, pokedex_entry) values (126, 'Born in an active volcano. Its body is always cloaked in flames, so it looks like a big ball of fire.');
insert into description (poke_id, pokedex_entry) values (127, 'If it fails to crush the victim in its pincers, it will swing it around and toss it hard.');
insert into description (poke_id, pokedex_entry) values (127, 'Its two long pincer horns are powerful. Once they grip an enemy, they wont release until the foe is torn.');
insert into description (poke_id, pokedex_entry) values (127, 'Grips its prey in its pincers and squeezes hard! It can''t move if it''s cold, so it lives in warm places.');
insert into description (poke_id, pokedex_entry) values (128, 'When it targets an enemy, it charges furiously while whipping its body with its long tails.');
insert into description (poke_id, pokedex_entry) values (128, 'When it is about to TACKLE, it whips its body repeatedly with its three long tails.');
insert into description (poke_id, pokedex_entry) values (128, 'A rowdy POKMON with a lot of stamina. Once running, it won''t stop until it hits something.');
insert into description (poke_id, pokedex_entry) values (129, 'In the distant past, it was somewhat stronger than the horribly weak descendants that exist today.');
insert into description (poke_id, pokedex_entry) values (129, 'It is virtually worthless in terms of both power and speed. It is the most weak and pathetic POKMON in the world.');
insert into description (poke_id, pokedex_entry) values (129, 'Famous for being very unreliable. It can be found swimming in seas, lakes, rivers and shallow puddles.');
insert into description (poke_id, pokedex_entry) values (130, 'Rarely seen in the wild. Huge and vicious, it is capable of destroying entire cities in a rage.');
insert into description (poke_id, pokedex_entry) values (130, 'It has an extremely aggressive nature. The HYPER BEAM it shoots from its mouth totally incinerates all targets.');
insert into description (poke_id, pokedex_entry) values (130, 'Brutally vicious and enormously destructive. Known for totally destroying cities in ancient times.');
insert into description (poke_id, pokedex_entry) values (131, 'A POKMON that has been over hunted almost to extinction. It can ferry people across the water.');
insert into description (poke_id, pokedex_entry) values (131, 'Its high intelligence enables it to understand human speech. It likes to ferry people on its back.');
insert into description (poke_id, pokedex_entry) values (131, 'A gentle soul that can read the minds of people. It can ferry people across the sea on its back.');
insert into description (poke_id, pokedex_entry) values (132, 'Capable of copying an enemy''s genetic code to instantly transform itself into a duplicate of the enemy.');
insert into description (poke_id, pokedex_entry) values (132, 'It can freely recombine its own cellular structure to transform into other life- forms.');
insert into description (poke_id, pokedex_entry) values (132, 'When it spots an enemy, its body transfigures into an almost perfect copy of its oppo nent.');
insert into description (poke_id, pokedex_entry) values (133, 'Its genetic code is irregular. It may mutate if it is exposed to radiation from element STONEs.');
insert into description (poke_id, pokedex_entry) values (133, 'An extremely rare POKMON that may evolve in a number of different ways depending on stimuli.');
insert into description (poke_id, pokedex_entry) values (133, 'Its genetic code is unstable, so it could evolve in a variety of ways. There are only a few alive.');
insert into description (poke_id, pokedex_entry) values (134, 'Lives close to water. Its long tail is ridged with a fin which is often mistaken for a mermaid''s.');
insert into description (poke_id, pokedex_entry) values (134, 'Its bodys cellular structure is similar to the molecular composition of water. It can melt invisibly in water.');
insert into description (poke_id, pokedex_entry) values (134, 'Its cell structure is similar to water molecules. It will melt away and become invis ible in water.');
insert into description (poke_id, pokedex_entry) values (135, 'It accumulates negative ions in the atmosphere to blast out 10000- volt lightning bolts.');
insert into description (poke_id, pokedex_entry) values (135, 'If it is angered or startled, the fur all over its body bristles like sharp needles that pierce foes.');
insert into description (poke_id, pokedex_entry) values (135, 'A sensitive POK MON that easily becomes sad or angry. Every time its mood changes, it charges power.');
insert into description (poke_id, pokedex_entry) values (136, 'When storing thermal energy in its body, its temperature could soar to over 1600 degrees.');
insert into description (poke_id, pokedex_entry) values (136, 'It has a flame bag inside its body. After inhaling deeply, it blows out flames of nearly 3,100 degrees Fahrenheit.');
insert into description (poke_id, pokedex_entry) values (136, 'It has a flame chamber inside its body. It inhales, then blows out fire that is over 3,000F degrees.');
insert into description (poke_id, pokedex_entry) values (137, 'A POKMON that consists entirely of programming code. Capable of moving freely in cyberspace.');
insert into description (poke_id, pokedex_entry) values (137, 'Using the most advanced technologies, scientists finally succeeded in making the first artificial POKMON.');
insert into description (poke_id, pokedex_entry) values (137, 'The only POKMON people anticipate can fly into space. None has managed the feat yet, however.');
insert into description (poke_id, pokedex_entry) values (138, 'Although long extinct, in rare cases, it can be genetically resurrected from fossils.');
insert into description (poke_id, pokedex_entry) values (138, 'A prehistoric POKMON that lived in the primordial sea, it swims by twisting its 10 tentacles about.');
insert into description (poke_id, pokedex_entry) values (138, 'An ancient POKMON that was recovered from a fossil. It swims by cleverly twisting its 10 tentacles about.');
insert into description (poke_id, pokedex_entry) values (139, 'A prehistoric POKMON that died out when its heavy shell made it impossible to catch prey.');
insert into description (poke_id, pokedex_entry) values (139, 'Its tentacles are highly developed as if they are hands and feet. As soon as it ensnares prey, it bites.');
insert into description (poke_id, pokedex_entry) values (139, 'Sharp beaks ring its mouth. Its shell was too big for it to move freely, so it became extinct.');
insert into description (poke_id, pokedex_entry) values (140, 'A POKMON that was resurrected from a fossil found in what was once the ocean floor eons ago.');
insert into description (poke_id, pokedex_entry) values (140, 'This POKMON was regenerated from the fossil of an ancient creature. It protects itself with a hard shell.');
insert into description (poke_id, pokedex_entry) values (140, 'A POKMON that was recovered from a fossil. It uses the eyes on its back while hiding on the sea floor.');
insert into description (poke_id, pokedex_entry) values (141, 'Its sleek shape is perfect for swim ming. It slashes prey with its claws and drains the body fluids.');
insert into description (poke_id, pokedex_entry) values (141, 'It swims freely through water. It catches prey with its scythe-like arms and drains the victims fluids.');
insert into description (poke_id, pokedex_entry) values (141, 'A slim and fast swimmer. It slices its prey with its sharp sickles and drinks the body fluids.');
insert into description (poke_id, pokedex_entry) values (142, 'A ferocious, pre historic POKMON that goes for the enemy''s throat with its serrated saw-like fangs.');
insert into description (poke_id, pokedex_entry) values (142, 'It was regenerated from a dinosaurs genetic matter that was found in amber. It flies with high-pitched cries.');
insert into description (poke_id, pokedex_entry) values (142, 'A savage POKMON that died out in ancient times. It was resurrected using DNA taken from amber.');
insert into description (poke_id, pokedex_entry) values (143, 'Very lazy. Just eats and sleeps. As its rotund bulk builds, it becomes steadily more slothful.');
insert into description (poke_id, pokedex_entry) values (143, 'It is not satisfied unless it eats over 880 pounds of food every day. When it is done eating, it goes promptly to sleep.');
insert into description (poke_id, pokedex_entry) values (143, 'Will eat anything, even if the food happens to be a little moldy. It never gets an upset stomach.');
insert into description (poke_id, pokedex_entry) values (144, 'A legendary bird POKMON that is said to appear to doomed people who are lost in icy mountains.');
insert into description (poke_id, pokedex_entry) values (144, 'One of the legendary bird POKMON. With its long tail trailing behind, its flying form is magnificent.');
insert into description (poke_id, pokedex_entry) values (144, 'A legendary bird POKMON. It freezes water that is contained in winter air and makes it snow.');
insert into description (poke_id, pokedex_entry) values (145, 'A legendary bird POKMON that is said to appear from clouds while dropping enormous lightning bolts.');
insert into description (poke_id, pokedex_entry) values (145, 'One of the legendary bird POKMON. While it is flying, it makes crackling and snapping sounds.');
insert into description (poke_id, pokedex_entry) values (145, 'This legendary bird POKMON is said to appear when the sky turns dark and lightning showers down.');
insert into description (poke_id, pokedex_entry) values (146, 'Known as the legendary bird of fire. Every flap of its wings creates a dazzling flash of flames.');
insert into description (poke_id, pokedex_entry) values (146, 'One of the legendary bird POKMON. Those seeing it are overwhelmed by its orange wings that seem to be on fire.');
insert into description (poke_id, pokedex_entry) values (146, 'A legendary bird POKMON. As it flaps its flaming wings, even the night sky will turn red.');
insert into description (poke_id, pokedex_entry) values (147, 'Long considered a mythical POKMON until recently when a small colony was found living underwater.');
insert into description (poke_id, pokedex_entry) values (147, 'Even the young can exceed 6.5 feet in length. It grows larger by repeatedly shedding skin.');
insert into description (poke_id, pokedex_entry) values (147, 'The existence of this mythical POKMON was only recently confirmed by a fisherman who caught one.');
insert into description (poke_id, pokedex_entry) values (148, 'A mystical POKMON that exudes a gentle aura. Has the ability to change climate conditions.');
insert into description (poke_id, pokedex_entry) values (148, 'It is said to live in seas and lakes. Even though it has no wings, it has been seen flying occasionally.');
insert into description (poke_id, pokedex_entry) values (148, 'According to a witness, its body was surrounded by a strange aura that gave it a mystical look.');
insert into description (poke_id, pokedex_entry) values (149, 'An extremely rarely seen marine POKMON. Its intelligence is said to match that of humans.');
insert into description (poke_id, pokedex_entry) values (149, 'It can fly in spite of its big and bulky physique. It circles the globe in just 16 hours.');
insert into description (poke_id, pokedex_entry) values (149, 'It is said that this POKMON lives somewhere in the sea and that it flies. However, it is only a rumor.');
insert into description (poke_id, pokedex_entry) values (150, 'It was created by a scientist after years of horrific gene splicing and DNA engineering experiments.');
insert into description (poke_id, pokedex_entry) values (150, 'A POKMON whose genetic code was repeatedly recombined for research. It turned vicious as a result.');
insert into description (poke_id, pokedex_entry) values (150, 'Its DNA is almost the same as MEW''s. However, its size and disposition are vastly dif ferent.');
insert into description (poke_id, pokedex_entry) values (151, 'So rare that it is still said to be a mirage by many experts. Only a few people have seen it worldwide.');
insert into description (poke_id, pokedex_entry) values (151, 'A POKMON of South America that was thought to have been extinct. It is very intelligent and learns any move.');
insert into description (poke_id, pokedex_entry) values (151, 'When viewed through a micro scope, this POKMON''s short, fine, delicate hair can be seen.');
